// App.jsx
import {
  BrowserRouter,
  Routes,
  Route,
  Navigate,
  useLocation
} from 'react-router-dom';

import { DarkModeProvider } from './Components/DarkModeContext';
import Accueil from './Pages/Home/Accueil';
import Home from './Pages/Home/Home';
import Login from './Pages/Auth/Login';
import Register from './Pages/Auth/Register';
import MesCandidatures from './Pages/Offre/MesCandidatures';
import PostulerOffre from './Pages/Entreprise/Postuler';
import OffreDetails from './Pages/Offre/OffreDetails';
import OffreEntreprise from './Pages/Offre/OffresEntreprise';
import DashboardAdmin from './Pages/Dashbord/DashboardAdmin';
import DashboardEntreprise from './Pages/Dashbord/DashboardEntreprise';
import DashboardMinistere from './Pages/Dashbord/DashboardMinistere';
import EntrepriseHome from './Pages/Entreprise/EntrepriseHome';
import MinistereHome from './Pages/Ministere/MinistereHome';
import Navbar from './Components/Navbar'; 
import CreerOffre from './Pages/M/CreerOffre';
import PrivateRoute from './Components/PrivateRoute';
import GestionCandidatures from './Pages/Ministere/GestionCandidatures';

function App() {
  const location = useLocation();

  // Ne pas afficher la Navbar sur les pages d'authentification
  const hideNavbar = ['/login', '/register'].includes(location.pathname.toLowerCase());

  return (
    <>
      {!hideNavbar && <Navbar />}

      <Routes>
        {/* Routes publiques */}
        <Route path="/" element={<Accueil />} />
        <Route path="/home" element={<Home />} />
        <Route path="/ministere/home" element={<MinistereHome />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/Dashbord/Ministere" element={<DashboardMinistere />} />
        <Route path="/ministere/CreerOffre" element={<CreerOffre />} />
        <Route path="/ministere/GestionCandidatures" element={<GestionCandidatures />} />
        
        

        {/* Pages ministère */}
        <Route path="/ministere/home" element={
          <PrivateRoute roles={['ministere']}>
            <MinistereHome />
          </PrivateRoute>
        } />
        <Route path="/ministere/GestionCandidatures" element={
          <PrivateRoute roles={['ministere']}>
            <GestionCandidatures />
          </PrivateRoute>
        } />
        <Route path="/ministere/CreerOffre" element={
          <PrivateRoute roles={['ministere']}>
            <CreerOffre />
          </PrivateRoute>
        } />
        <Route path="/dashboard/DashbordMinistere" element={
          <PrivateRoute roles={['ministere']}>
            <DashboardMinistere />
          </PrivateRoute>
        } />

        {/* Tableaux de bord admin */}
        {/* <Route path="/dashboard/admin" element={
          <PrivateRoute roles={['admin']}>
            <DashboardAdmin />
          </PrivateRoute>
        } /> */}

        {/* Pages entreprise */}
        <Route path="/entreprise/home" element={
          <PrivateRoute roles={['entreprise']}>
            <EntrepriseHome />
          </PrivateRoute>
        } />
        
        <Route path="/dashboard/DashbordEntreprise" element={
          <PrivateRoute roles={['entreprise']}>
            <DashboardEntreprise />
          </PrivateRoute>
        } />
        <Route path="/entreprise/MesCandidatures" element={
          <PrivateRoute roles={['entreprise']}>
            <MesCandidatures />
          </PrivateRoute>
        } />
        <Route path="/entreprise/postuler/:offerId" element={
          <PrivateRoute roles={['entreprise']}>
            <PostulerOffre />
          </PrivateRoute>
        } />

        {/* Détail offre (public ou protégé selon ton choix) */}
        <Route path="/offre/:id" element={<OffreDetails />} />

        {/* Redirection pour routes inconnues */}
        <Route path="*" element={<Navigate to="/" replace />} />
      </Routes>
    </>
  );
}

// Wrapper avec BrowserRouter et DarkModeProvider
function AppWithRouter() {
  return (
    <BrowserRouter>
      <DarkModeProvider>
        <App />
      </DarkModeProvider>
    </BrowserRouter>
  );
}

export default AppWithRouter;
